import React from "react";

import CategoryReport from "../components/CategoryReport";

const Admin = () => {
    return (
        <div className="root-adm">
            <div className="header">
                <img
                    src={"../../../public/svg/logo.svg"}
                    alt=""
                    className="avatar"
                />
                <CategoryReport />
            </div>
        </div>
    );
};

export default Admin;
